import React from 'react';
import * as Resume from './resume.js';
import './App.css';
import 'bootstrap/dist/css/bootstrap.css';
import Helmet from "react-helmet";

export class App extends React.Component{

    App() {
        return (
            <div className="container">
                <Helmet/>
                <Resume.Resume/>
            </div>
        );
    }
}


export default App;
